import React, { useState, useEffect } from "react";

export default function Tracks({ tracklist }) {
  return (
    <div>
      <ul className="track-list">
        {tracklist &&
          tracklist.map((el) => {
            if (el.artists > 1) {
              return (
                <li className="tracks-wrapper">
                  <p className="tracks-title">{el.artists[0].name}</p>
                  <span>-</span>
                  <p>{el.title}</p>
                </li>
              );
            } else {
             
              // return <li>{el.title}</li>;

            }
          })}
      </ul>
    </div>
  );
}
